         x="0 5.2820001 10.564 13.471 19.275499 24.557501 28.253 31.9485 37.230499 43.035 48.317001 52.012501 57.817001 63.098999 68.903503 71.810501 79.2015 85.005997 90.810501 96.092499 101.897 104.804 109.554 112.195 115.8905 121.1725 124.868 127.775 133.5795 138.3295 143.6115 147.30701 150.214 155.496 160.778 166.06 168.967 172.66251 177.9445 180.58549 184.28101 187.9765 193.2585 196.95399"
         y="0"
         id="tspan306">På herregården Odden vises over 800 skitser </tspan><tspan
         x="0 5.8045001 11.609 14.516 19.266001 27.7115 31.407 36.688999 41.971001 45.6665 48.573502 53.855499 57.550999 60.458 64.153503 66.794502 70.319946 72.960953 75.86795 85.36795 88.008949 90.649948 93.290947 99.095451 107.54095 111.23645 116.51845 122.32295 124.96395 127.87095 130.51195 133.41895 138.70094 143.98296 146.88995 152.17195 155.86745 158.77444 163.52444 166.16545 169.86095 175.14294 180.42496 186.22945 191.51144 194.41846 200.22295 205.50494 211.30945"
         y="11.5045"
         id="tspan308">og værker af J.F. Willumsen. I 70 år virkede han </tspan><tspan
         x="0 3.6954999 9.5 17.945499 20.852501 29.298 34.580002 37.221001 42.502998 45.326401 47.9674 50.874401 56.678902 59.319901 61.960899 64.601898 69.883904 75.6884 81.492897 87.297401 93.101898 98.906403 104.1884 107.01085 109.65185 112.55885 118.36335 122.05885 127.34085 131.03635 133.67735 138.95935 144.24135 147.06474 149.70575 152.61275 157.89474 163.17674 166.87225 172.15425 180.59975 183.24075 188.52275 193.80475 197.50024 200.40726 206.21175 212.01625"
         y="23.009001"
         id="tspan310">som maler, billedhugger, grafiker, keramiker og </tspan><tspan
         x="0 5.2820001 8.9775 14.2595 16.900499 20.596001 25.878 31.16 34.855499 37.762501 43.567001 49.371498 52.2785 57.0285 62.310501 66.005997 68.913002 77.358498 82.640503 88.445 91.351997 95.047501 97.688499 100.3295 103.2365 108.5185 112.214 115.121 120.9255 126.73 130.42551 136.23 139.92551 148.371 153.653 156.56 162.3645 167.6465 173.451 176.358 184.8035 190.608 196.41251 201.6945 205.39 211.1945 216.4765"
         y="34.5135"
         id="tspan312">arkitekt og var med til at udforme den moderne </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 20.5865 25.8685 31.150499 34.057499 39.3395 45.144001 50.948502 54.644001 58.3395 60.980499 63.887501 68.637497 73.919502 82.364998 85.005997 87.647003 93.4515 99.255997 104.538 110.3425 114.038 116.945 120.6405 125.9225 131.2045 137.009 142.291 145.1144 147.7554 150.6624 156.82886 159.46985 163.68785 167.38335 173.18785 176.88335 179.79034 185.07236 190.35435 194.04985 199.33185 203.02734 206.72285 212.00485 217.80936 220.45035"
         y="46.018002"
         id="tspan314">danske kunst. Samlingens skaber, Victor Petersen, </tspan><tspan
         x="0 2.641 8.4455004 12.141 15.8365 21.641001 27.445499 33.25 37.467999 42.75 46.445499 51.727501 55.423 58.330002 60.971001 63.877998 69.160004 74.9645 77.871498 81.567001 84.208 86.848999 95.294502 98.2015 104.006 109.288 115.0925 118.788 121.695 124.336 126.977 131.72701 134.634 140.43851 146.243 149.14999 154.43201 160.2365 166.041 169.7365 173.43201 176.073 178.98 185.839 191.121 196.92551"
         y="57.522499"
         id="tspan316">introducerer i en film hans liv og kunst. Den </tspan><tspan
         x="0 5.8045001 11.0865 19.532 22.173 27.455 30.362 36.1665 41.448502 45.144001 48.8395 54.121498 57.817001 61.512501 66.794502 69.435501 75.239998 78.147003 81.842499 87.647003 96.092499 104.538 109.82 113.5155 116.4225 121.7045 127.509 130.416 136.2205 142.02499 145.7205 149.416 152.05701 154.698 157.339 159.98 165.7845 171.589 174.496 180.30051 188.746 191.653 199.04401 204.8485 210.653 215.935 221.7395 225.435"
         y="69.027"
         id="tspan318">gamle hestestald rummer en udstilling om Oddens </tspan><tspan
